import "./toggle.css"
import React from 'react';

const Toggle = () => {
    return (
        <div className="t">
            <img href="https://www.flaticon.com/de/kostenlose-icons/sonne" title="sonne Icons"/>
            <img href="https://www.flaticon.com/free-icons/moon" title="moon icons"/>
            <button className="t-button"> </button>
        </div>
    );
};

export default Toggle;
